import React from 'react';

const Song = ({ song }) => {
  return (
    <li>
      <img src={song.cover} alt={song.title} />
      <div>
        <h3>{song.title}</h3>
        <p>{song.artist}</p>
        <p>{song.duration}</p>
      </div>
    </li>
  );
};

export default Song;
